// Home.js

import React, { Component } from 'react';
// import gravatar from 'gravatar';
import { Link } from 'react-router-dom'

// const avatar = gravatar.url("app@vat.com",{
//     s: '400',
//     r: 'pg',
//     d: 'mm'
// });
export default class Home extends Component {
    render() {
        return (
            <div>
                <div className="container mt-5">
                    <div className="card dash-main-card">
                        <div className="card-header">
                            <label>Dashboard</label>
                        </div>
                        <div className="card-body">
                            <div className="container">
                                <div className="row">
                                    <div className="card col-xs-12 col-lg-4 dash_card m-1">
                                        {/* <img className="card-img-top" src={avatar} alt="Card image"
                                        style={{ width: '100%'}} /> */}
                                        <div className="card-body">
                                        <h4 className="card-title">Create Pet Profile</h4>
                                        <p className="card-text">Some example text some example text. John Doe is an architect and engineer</p>
                                        <Link to="#" className="btn btn-primary btn_dashboard">Create Profile</Link>
                                        </div>
                                    </div>
                                    <div className="card col-xs-12 col-lg-4 dash_card m-1">
                                        {/* <img className="card-img-top" src={avatar} alt="Card image"
                                        style={{ width: '100%'}} /> */}
                                        <div className="card-body">
                                        <h4 className="card-title">Create Pet Profile</h4>
                                        <p className="card-text">Some example text some example text. John Doe is an architect and engineer</p>
                                        <Link to="#" className="btn btn-primary btn_dashboard">Create Profile</Link>
                                        </div>
                                    </div>
                                    <div className="card col-xs-12 col-lg-4 dash_card m-1">
                                        {/* <img className="card-img-top" src={avatar} alt="Card image"
                                        style={{ width: '100%'}} /> */}
                                        <div className="card-body">
                                        <h4 className="card-title">Connect Consultant</h4>
                                        <p className="card-text">Some example text some example text. John Doe is an architect and engineer</p>
                                        <Link to="#" className="btn btn-primary btn_dashboard">Create Profile</Link>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
